DROP TABLE IF EXISTS `t_waybill`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_waybill` (
  `id` varchar(64) NOT NULL COMMENT '主键Id',
  `way_bill_no` varchar(255) DEFAULT NULL COMMENT '运单编号',
  `way_bill_name` varchar(255) DEFAULT NULL COMMENT '订单名称',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `current_status` int(11) DEFAULT NULL COMMENT '订单当前的状态(0--待稽查,1--稽查完成,2稽查确认)',
  `green_truck_plate` varchar(255) DEFAULT NULL COMMENT '车牌号',
  `green_truck_type` varchar(255) DEFAULT NULL COMMENT '绿通车类型',
  `audit_time` datetime DEFAULT NULL COMMENT '稽查时间',
  `audit_station` int(11) DEFAULT NULL COMMENT '稽查站点,根据数据库的码表来对应',
  `audit_express_way` int(11) DEFAULT NULL COMMENT '稽查高速',
  `current_driver_id` varchar(255) DEFAULT NULL COMMENT '当次运单关联的司机的id',
  `current_driver_name` varchar(255) DEFAULT NULL COMMENT '当前司机的姓名',
  `current_phone_no` varchar(255) DEFAULT NULL COMMENT '当前司机的手机号码',
  `current_auditor_id` varchar(64) DEFAULT NULL COMMENT '当前稽查人员的Id',
  `audit_conclusion_status` int(11) DEFAULT NULL COMMENT '稽查结论状态(0--未通过,补缴逃费    1--放行)',
  `current_mass` varchar(255) DEFAULT NULL COMMENT '本次载重(单位:吨)',
  `double_check_auditor_id` varchar(64) DEFAULT NULL COMMENT '稽查复核人员id',
  `double_check_evaluate` varchar(1000) DEFAULT NULL COMMENT '稽查复核评价',
  `double_check_status` int(11) DEFAULT NULL COMMENT '稽查复核状态(0--未复核,1---复核通过,2---复核未通过)',
  `audit_conclusion_flowId` varchar(255) DEFAULT NULL COMMENT '稽查结论id',
  `first_cargos` varchar(255) DEFAULT NULL COMMENT '一级货物分级(多选)(暂时弃用)',
  `second_cargos` varchar(255) DEFAULT NULL COMMENT '二级货物分级(多选)',
  `vehicle_identification_no` varchar(255) DEFAULT NULL COMMENT '车辆识别号',
  `driver_write_cargos` varchar(255) DEFAULT NULL COMMENT '记录司机选中填写的货品分类(多选用逗号分隔)',
  `driver_write_mass` varchar(255) DEFAULT NULL COMMENT '记录司机端填写的载重',
  `over_due_time` datetime DEFAULT NULL COMMENT '过期失效时间',
  `qrcode_path` varchar(255) DEFAULT NULL COMMENT '二维码路径',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

